function doSearch(){let b=$("#duration").val();$.ajax({url:"assetList.php",data:{start:$("#startDate").val(),end:$("#endDate").val(),duration:b,pax:$("#pax").val()},success:function(a){$("#resultList").html(a)}})}function processBooking(b){let a=[];$.each(b,function(b,c){a.push({id:c.id,value:c.value})});a=JSON.stringify(a);$.ajax({url:"processBooking.php",type:"POST",data:{info:a},success:function(a){$("#modal-body").html(a)}})}
function findRes(b){$.ajax({url:"searchResult.php",type:"GET",data:{searchString:b},success:function(a){$("#tblSearchResult tbody").html(a)}})};